import { Link } from "react-router-dom";

function EventsPage() {
  const Events = [
    { id: "e1", title: "Event 1" },
    { id: "e2", title: "Event 2" },
    { id: "e3", title: "Event 3" },
  ];
  return (
    <div>
      <h1>Events Page</h1>
      <ul>
        {Events.map((event) => {
          <li>
            <Link to={event.id}>{event.title}</Link>
          </li>;
        })}
      </ul>
    </div>
  );
}

export default EventsPage;
